      <div
        
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      > <div
      className={month.includes('11') ? 'slideBarUp' : 'slideBarDown'} 
        style={{
          backgroundColor: "#3d21a7",
          height: month.includes('11') ? `${sum/sum}%` : "0",
          width: 15,
          borderRadius: 20,
          bottom: 0,
          border: "0px solid black",
          position: "absolute",
         
        }}
        ></div>
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Nov
        </b>
      </div>
      <div
        
        style={{
          backgroundColor: "#bbabef",
          height: "80%",
          width: 15,
          borderRadius: 20,
          marginLeft: 40,
          border: "1px solid black",
          position: "relative",
        }}
      > <div
      className={month.includes('12') ? 'slideBarUp' : 'slideBarDown'} 
        style={{
          backgroundColor: "#3d21a7",
          height: month.includes('12') ? `${sum/sum}%` : "0",
          width: 15,
          borderRadius: 20,
          bottom: 0,
          border: "0px solid black",
          position: "absolute",
         
        }}
        ></div>
        <b
          style={{
            position: "absolute",
            marginTop: 145,
            fontSize: 10,
          }}
        >
          Dec
        </b>
      </div>
    </div>
  );
}

